import React from 'react';
import homeCSS from './home.css';
import PlaquesArt from './PlaquesArt';
import plaquesCSS from './plaques.css';

function Home() {

    return (
      <div>
          <PlaquesArt />
          <img src="./images/fixed.png" id = "Framed_Slanted_Green_Lake" alt = "Green Lake"/>
          <img src="./images/Actual-Slanted.png" id = "Slanted_Green_Lake" alt = "Green Lake"/>
          {/* <img src="./images/cat.png" id = "Slanted_Green_Lake" width = "190" alt = "Green Lake"/> */}

          <img src = "./images/emptyFrame-ghibli-carosel.png" id = "Framed_Ghibili_House" height = "150"  alt = "Ghibili_House"></img>
          <img src = "./images/Ghibili_House.jpg" id = "Ghibili_House" height = "150"  alt = "Ghibili_House"></img>

          <img src = "./images/emptyFrame-ghibli-carosel.png" id = "Framed_Carosel_Path" height = "150"  alt = "Carosel_Path"></img>
          <img src = "./images/Carosel_Path.jpg" id = "Carosel_Path" height = "150"  alt = "Carosel_Path"></img>

          {/* <img src="./images/empty-slanted-frame.png" id = "Framed_Slanted_Cooling-Mist" width = "170" alt = "Green Lake"/> */}
          <img src="./images/empty-Slanted-Framed-CM.png" id = "Framed_Slanted_Cooling-Mist" height = "260" alt = "Cooling Mist"/>
          {/* <img src="./images/slantedCoolingMist.png" id = "Slanted_Cooling_Mist" height = "260"  alt = "Cooling Mist"></img> */}
          <img src="./images/straight.png" id = "Slanted_Cooling_Mist"  alt = "Cooling Mist"></img>

          {/* <img src="./images/closed-door.jpg" id = "closed-door" height = "200"></img> */}
          <img src="./images/girl.png" id = "silhuotte1" alt = "little-girl-silhuotte1"/>
          <img src="./images/cartoon.png" id = "silhuotte2" alt = "silhuotte2"/>
      </div>
    )
}

export default Home;
